import React, { useState } from "react";
import "./App.css";

export default function App() {
  const [val, setVal] = useState("");
  return (
    <div className="App">
      <input
        type="text"
        onChange={e => setVal(e.target.value)}
        style={{ marginTop: "2em" }}
      />
      <button onClick={() => console.log(val)} type="submit">
        Add Todo
      </button>
    </div>
  );
}
